import React, { Component, useState, useEffect } from "react";
import { AwesomeButton, AwesomeButtonProgress } from "react-awesome-button";
import "react-awesome-button/dist/styles.css";
import "../DetectFaces/DetectFaces.css";
import Database from "../Database/Database";
import firebase from "../../config/firebase";
import * as faceapi from "face-api.js";
var db = firebase.firestore();

const DetectFaces = () => {

  const [images, setImages] = useState([]); //state variable for storing/retrieving existing images from Firebase
  const [recentUpload, setUpload] = useState([]); //state variable for storing/retrieveing recently uploaded reference image
  const [name, setName] = useState(""); //set image name for reference image (recently uploaded image)
  const [retrieveReferenceImage, setReferenceImage] = useState([]); //test for recent image
  const [imageSrc, setImageSrc] = useState("");
  const faceDetectionOptions = new faceapi.SsdMobilenetv1Options({ minConfidence: 0.75 });
  const imageFromFirebase = document.getElementById("myImg") //define hidden img element to use for prediction

  useEffect(() => {
    db.collection("recentUpload").get().then((querySnapshot) => {
      recentUpload.length = 0;
      querySnapshot.forEach((doc) => {
        setUpload(oldArray => [...oldArray, doc.data()]);
      });
    });

    db.collection("images").get().then((querySnapshot) => {
      images.length = 0;
      querySnapshot.forEach((doc) => {
        setImages(oldArray => [...oldArray, doc.data()]);
      });
    });
  }, []);

   async function initialiseFaceAPI() {
    // if (initialiseFaceAPI) {
    //   return;
    // }
    //Load all models
     await Promise.all([
      faceapi.nets.ssdMobilenetv1.load('/models'),
      faceapi.nets.faceLandmark68Net.load('/models'),
      faceapi.nets.faceRecognitionNet.load('/models')
    ]);
  }

  async function storeNewReferenceImage() {
    let recentReferenceImage = [];
     await firebase.firestore().collection('recentUpload').get()
      .then(querySnapshot => {
        querySnapshot.docs.forEach(doc => {
        recentReferenceImage.push(doc.data().image)
      });
    });
    await setReferenceImage(recentReferenceImage)
  }

  //Main asynchronous function to find all faces in reference/recent image (when comparing face decriptors/feature vectors with feature vectors generated from existing database images)
   async function findAllFacesInRecentImage(){
     await initialiseFaceAPI() //initialise and load all models
     await storeNewReferenceImage() //set state variable to new img src for recently uploaded reference image
     await updateHiddenIMG() //update existing hidden IMG state to new img state

      let doc1 = [];
      let labels = [];
      let doc2 = [];
      let descriptions = [];
      let i = 0
      while (i <  images.length){
        doc1.push(images[i])
        i++
      }

      let j = 0
      while (j < doc1.length){
        doc2.push(doc1[j])
        j++
      }

      let k=0
      while (k < doc2.length){
        const img = await faceapi.fetchImage(doc2[k].image)
        const detections = await faceapi.detectAllFaces(img, faceDetectionOptions).withFaceLandmarks().withFaceDescriptors()
        labels.push(doc2[k].name + ' ' + '(' + doc2[k].target + ')')
        descriptions.push(detections[0].descriptor)
        k++
      }

      let o = 0;
      const labelledFaceDescriptors = [];
      while(o < doc2.length){
        labelledFaceDescriptors.push(new faceapi.LabeledFaceDescriptors(labels[o], [descriptions[o]]))
        o++
    }
    
     //Store basic detection results for reference image & resize to fit reference/recent image canvas
    const results =  await faceapi.detectAllFaces(imageFromFirebase, faceDetectionOptions).withFaceLandmarks().withFaceDescriptors();
    const detectionsForSize = faceapi.resizeResults(results, { width: imageFromFirebase.width, height: imageFromFirebase.height })

    const faceMatcher = new faceapi.FaceMatcher(labelledFaceDescriptors)
    let recognitionMatches = [];
    let recognitionMatchesLabelOnly = [];
    detectionsForSize.forEach(descriptor =>{
    const bestMatch = faceMatcher.findBestMatch(descriptor.descriptor)
      recognitionMatches.push(bestMatch)
      recognitionMatchesLabelOnly.push(bestMatch.label)
      console.log(bestMatch.toString())
    })

    const canvas = document.getElementById('firstCanvas')
    canvas.width = imageFromFirebase.width
    canvas.height = imageFromFirebase.height
    const ctx = canvas.getContext("2d")
    ctx.drawImage(imageFromFirebase,0,0,canvas.width, canvas.height)
    //await faceapi.draw.drawDetections(canvas, detectionsForSize, {withScore: true})

   let p = 0;
   while(p < detectionsForSize.length){
    const box = detectionsForSize[p].detection.box
    const drawBox = new faceapi.draw.DrawBox(box, { label: recognitionMatchesLabelOnly[p] })
    drawBox.draw(canvas)
    p++
   }
    // const boxesWithText = [
    //   new faceapi.LabeledBox(new faceapi.Rect(345.29962158203125, 138.76455846864576, 57.37786865234375, 80.61442249141938), 50000)
    // ]
    return results;
  }

async function requestPredictionsForAllDetectedFaces(){
  await findAllFacesInRecentImage();
}

async function updateHiddenIMG(){
  await (document.getElementById('myImg').src = retrieveReferenceImage[0])
  console.log('img source updated')
}

  function getPathToImage() {
    var name1 = "RecentImage"
    var Name = name1.replace(/\s/g, '');
    setName(name1);
    return Name;
  }

  function addToDatabase() {
    var path = getPathToImage();
    var myObj = {
      image: imageSrc,
      identifier: getPathToImage()
    }

    db.collection("recentUpload").doc(path).set(
      myObj
    ).then(() => {
      console.log("Document successfully written!");
      setUpload(oldArray => [...oldArray, myObj]);
    }).catch((error) => {
      console.warn(error);
    });

    const timer = setTimeout(() => {
      detectFacesWindowRefresh();
        }, 200)  
      return () => clearTimeout(timer);      
  }

  function detectFacesWindowRefresh(){
    window.location.href="/Detect"
  }

  function captureFile(e) {
    const file = e.target.files[0];

    if (file) {
      const reader = new FileReader();

      reader.readAsDataURL(file);
      reader.onloadend = () => {
        setImageSrc(reader.result);
      };
    }
  }

  return (
    <>
      <div className="maindiv">
        <h1 className="temp">Detect Faces!</h1>
        <p>Upload an image containing known faces to perform a prediction!</p>
        <br></br>
        <div>{
          recentUpload.map((image) => (
            <Database image={image}/>  
          ))
          }
          <canvas id = "firstCanvas"></canvas>
          <img id="myImg" className="hide" src="data:image/jpeg;base64,"/>
        </div>
        <div className="mainContent">
          <div className="inputfields">
            <div>
              <input
                type="file"
                id="imageField"
                accept="image/*"
                className="image-input"
                onChange={(e) => captureFile(e)}
              />
            </div>
            <br />
            <div className="buttonsFlex">
            <AwesomeButton onPress={() => {
              addToDatabase();
            }}
              type="secondary"
              style={myButtonStyle}>1. Select this image for detection</AwesomeButton>
              <br></br>
              <AwesomeButton onPress={() => {
              requestPredictionsForAllDetectedFaces();
            }}
              type="secondary"
              style={myButtonStyle}>2. Detect faces within displayed image</AwesomeButton>
          <br></br>
          <AwesomeButton onPress={() => {
              window.location.href="/Upload"
            }}
              type="secondary"
              style={myButtonStyle}>3. Upload another face</AwesomeButton>
              <br></br>
              </div>
          </div>
        </div>
      </div>
    </>
  );
}

const myButtonStyle = {
  width: "16vw",
  height: "4vh",
  fontSize: "50%",
};

export default DetectFaces;